import Link from 'next/link';

const Navbar = () => {
    return (
        <nav className="nav">
            <ul>
                <li>
                    <a href="/">Home</a>
                </li>
                <li>
                    <a href="https://github.com/reecerussell">Github</a>
                </li>
                <li>
                    <a href="/Projects">Projects</a>
                </li>
            </ul>
        </nav>
    );
}

export default Navbar;
